import React from 'react'
import brand1 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/GlazeArt-Main-91.png';
import brand2 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/Asset 2.png';
import brand3 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/Nirvana.png';
import brand4 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/JSMR.png';
import brand5 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/MAHLE-Logo.png';
import brand6 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/TNR.png';
import brand7 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/Omar.png';
import brand8 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/Baby ville.png';
import brand9 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/Wildfrost.png';
import brand10 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/KNM.png';
import brand11 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/Aakruthe.png';
import './Brands.css';

 const Brands = () => {
  return (
    <div className='brands-container '>
     <div className='brands my-20'>
        <h1 className='brands-heading font-medium font-cairo text-center' >Brands we helped Grow</h1>
    </div>
    <div className='flex justify-between gap-36 '>
        <img src={brand1} alt='glaze art' className='h-20 w-auto'/>
        <img src={brand2} alt='indian bliss' className='h-20 w-auto'/>
        <img src={brand3} alt='nirvana' className='h-20 w-auto'/>
        
          
    </div>

    <div className='mt-20  flex justify-between gap-32 '>
        
        <img src={brand4} alt='jai santoshi mata realtors' className='h-28 w-auto'/>
        <img src={brand6} alt='TNR' className='h-20 w-auto'/>
        <img src={brand7} alt='Omar condultants' className='h-32 w-auto'/>  
        <img src={brand8} alt='baby ville' className='h-36 w-auto'/>
          
    </div>

    <div className='mt-10 flex justify-between gap-28 '>
        <img src={brand5} alt='mahle' className='h-36 w-auto '/>
        <img src={brand9} alt='wild frost' className='h-44 w-auto'/>  
        <img src={brand10} alt='knm smile' className='h-44 w-auto'/>
        <img src={brand11} alt='aakruthee' className='h-44 w-auto'/>
       
    </div>
    </div>
   
  )
}

export default Brands;
